import React, { useState } from 'react';
import axios from 'axios';

function ExcelForm() {
  const [formData, setFormData] = useState({
    name: '',
    age: '',
    email: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('YOUR_MICROSOFT_GRAPH_API_ENDPOINT', formData);
      console.log('Data saved to Excel Online:', response.data);
      alert('Data saved successfully!');
    } catch (error) {
      console.error('Error saving data to Excel Online:', error);
      alert('Failed to save data. Please try again later.');
    }
  };

  return (
    <div>
      <h2>Enter Data to Save in Excel Online</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Name:</label>
          <input type="text" name="name" value={formData.name} onChange={handleChange} />
        </div>
        <div>
          <label>Age:</label>
          <input type="number" name="age" value={formData.age} onChange={handleChange} />
        </div>
        <div>
          <label>Email:</label>
          <input type="email" name="email" value={formData.email} onChange={handleChange} />
        </div>
        <button type="submit">Save to Excel</button>
      </form>
    </div>
  );
}

export default ExcelForm;
